import React, { useState, useEffect } from 'react';
import "./homepage.css"
import axios from 'axios'

const Homepage = ({setLoginUser, user}) => {
    const [repos, setRepos] = useState([]);

    useEffect(() => {
        async function gitrepo() {
            const  result  = await axios(`https://api.github.com/users/${user.gituser}/repos`);
            setRepos(result.data);
        }
        gitrepo();
      }, []);

      const listRepos = () =>{
        repos.map((item) => {
            console.log(item)
          });
      } 

      console.log(repos)
    return(
        <div className='homepage'>
            {repos.length>1?listRepos:null}
            {console.log(user)}
            <h1>Hi {user.name}</h1>
            {/* <button onClick={gitrepo}></button> */}
            <div className='button' onClick={() => setLoginUser({})}>Logout</div>    
        </div>
    )
}

export default Homepage
